import React from 'react'
import Cards from './Cards'


const Project = () => {
    return (
        <React.Fragment>
            <h1 className="text-center font-[archivo-regular] text-[3.5rem] pt-[3rem] pb-[1rem]">Projects</h1>
            <Cards></Cards>
        </React.Fragment>
    )
}

export default Project
